        private static byte[] HexStringToBytes(string bytes)
        {
            byte[] results = new byte[bytes.Length / 2];

            for (int i = 0; i < bytes.Length; i += 2)
            {
                results[i / 2] = byte.Parse(bytes.Substring(i, 2), System.Globalization.NumberStyles.HexNumber);
            }
            return results;
        }

        public static bool ArrayContentsAreEqual(byte[] A, byte[] B)
        {
            // subject to timing attacks; use this method only for the regimented tests, not in production
            if (A == null || B == null)
                throw new ArgumentNullException();
            if (A.Length != B.Length)
                return false;
            for (int i = 0; i < A.Length; i++)
            {
                if (A[i] != B[i])
                    return false;
            }
            return true;
        }

